descr:
FICA A PESSOA JURÍDICA NOTIFICADA DA ENTREGA DOS SEGUINTES LAUDOS DE ANÁLISE DE PRODUTOS COLETADOS NESTE ESTABELECIMENTO, EMITIDOS PELO LABORATÓRIO DE SAÚDE PÚBLICA DR. GIOVANNI CYSNEIROS:
1) LAUDO DE ANÁLISE Nº 202.1P.0/2025 DO PRODUTO REQUEIJÃO CREMOSO, MARCA BOUA, COM RESULTADO SATISFATÓRIO PARA TODAS AS ANÁLISES REALIZADAS;
2) LAUDO DE ANÁLISE Nº 203.1P.0/2025 DO PRODUTO MEL FLORADA MULTI-FLORA, MARCA BIZZ NÉCTAR, COM RESULTADO INSATISFATÓRIO PARA ANÁLISE DE ROTULAGEM E SATISFATÓRIO PARA AS DEMAIS ANÁLISES REALIZADAS.
